// ==UserScript==
// @name         Push helper
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  help with pushes
// @author       StatikusGreek [1942339]
// @include      https://www.torn.com/competition.php
// @grant        none
// ==/UserScript==

let ticks = [0, 15, 30, 45];
// CHANGE THIS if you want
// (this is the minutes before the tick
// when you want to be announced)
// Currently it's set to alert at
// 10, 5, 3, 2, 1 mins before tick
// (the count or order doesn't matter)
// You can set it at [1] for all I care
// You can't set it at something like 0.5,
// only minutes work.
let minutes = [1, 2, 3, 5, 10];

//https://freesound.org/people/shinephoenixstormcrow/sounds/337049/
let lastMin = new Date().getMinutes();
//found on https://stackoverflow.com/questions/879152/how-do-i-make-javascript-beep
function beep() {
    var snd = new Audio("data:audio/mpeg;base64,");
    snd.play();
}

function f()
{
    let date = new Date();
    // add 10 for security
    date.setSeconds(date.getSeconds() + 10);
    date = date.getMinutes();
    let tick = 0;
    for (let i = 0; i < ticks.length; i++)
    {
        if (lastMin < ticks[i])
        {
            tick = ticks[i];
            break;
        }
    }
    for (let i = 0; i < minutes.length; i++)
    {
        if (lastMin < (tick - minutes[i] + 60) % 60
         && date >= (tick - minutes[i] + 60) % 60)
        {
            beep();
        }
    }
    lastMin = date;
    setTimeout(f, 100);
}

(function() {
  'use strict';
  setTimeout(f, 100);
  beep();
})();
